import React from 'react';
import './MetricsDisplay.css';

function MetricsDisplay({ metrics }) {
  const metricsList = [
    { label: 'AQI', value: metrics.aqi, unit: '', icon: 'üí®' },
    { label: 'Hospital Load', value: metrics.hospital_load, unit: '%', icon: 'üè•' },
    { label: 'Temperature', value: metrics.temperature, unit: '¬∞C', icon: 'üå°Ô∏è' },
    { label: 'Crop Supply', value: metrics.crop_supply, unit: '%', icon: 'üåæ' },
    { label: 'Food Price Index', value: metrics.food_price_index, unit: '', icon: 'üíπ' },
    { label: 'Traffic Density', value: metrics.traffic_density, unit: '', icon: 'üöó' }
  ];

  return (
    <div className="metrics-display">
      <h2>Current Metrics</h2>
      <div className="metrics-grid">
        {metricsList.map((metric, idx) => (
          <div key={idx} className="metric-card">
            <div className="metric-icon">{metric.icon}</div>
            <div className="metric-label">{metric.label}</div>
            <div className="metric-value">
              {metric.value}
              <span className="metric-unit">{metric.unit}</span>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default MetricsDisplay;
